import React, { Component } from "react";
import {Bar} from 'react-chartjs-2';
import "./styles/bar-graph.css"


class AddEmployeeForm extends Component {
  constructor(props) {
    super(props);
  }

  render() {

    return (
      <div>
      <Bar
        data = {0}
      	width={100}
      	height={50}
      	options={{
      		  maintainAspectRatio: false
          }}
      />

      </div>
    );
  }
}

export default AddEmployeeForm;
